package com.test;

import java.util.HashMap;
import java.util.Map;

public class MainClase {

	public static void main(String[] args) {
				
	    java.util.Date date = new java.util.Date();
	    System.out.println("Init: " + date);
	    System.out.println(" ");
		
		String dataSource = "";
		
		findDuplicateCharacters(dataSource);
		
		System.out.println(" ");
		
	    java.util.Date date1 = new java.util.Date();
	    System.out.println("End: " + date1);
			
	}

	private static Map<Character, Integer> findDuplicateCharacters(String dataSource) {
		
		Map<Character, Integer> duplicateList = new HashMap<Character, Integer>();
				
		char characterList[] = dataSource.toCharArray();
		
		for(char character : characterList) {
						
			Integer countLetter = duplicateList.get(character);		
			
			if(countLetter == null) {
				duplicateList.put(character, 1);
				
			}else {
				duplicateList.put(character, ++countLetter);
			}
			
			
		}// end for()
		
		return duplicateList;
		
	}// end method findDuplicateCharacters()
	
}
